pragma solidity ^0.4.24;

import "./EternalStorage.sol";

library SecurityLibrary {

  event addAdminEvent(
    address indexed user
  );
  event removeAdminEvent(
    address indexed user
  );

  function getAdminsCount(address _storageContract) public view returns(uint) 
  {
    return EternalStorage(_storageContract).getUIntValue(keccak256("AdminsCount"));
  } 
	
  function addAdmin(address _storageContract, address _user) public
  {
    //require(
    //  !EternalStorage(_storageContract).getBooleanValue(keccak256(abi.encodePacked("admin:", _user))),
    //  "User is already an admin."
    //);
    EternalStorage(_storageContract).setBooleanValue(keccak256(abi.encodePacked("admin:", _user)), true);

    // Increment the admins count in storage
    uint adminsCount = EternalStorage(_storageContract).getUIntValue(keccak256("AdminsCount"));
    EternalStorage(_storageContract).setUIntValue(keccak256("AdminsCount"), adminsCount + 1);

    emit addAdminEvent(_user);
  }

  function removeAdmin(address _storageContract, address _user) public
  {
    require(
      !EternalStorage(_storageContract).getBooleanValue(keccak256(abi.encodePacked("admin:", _user))),
      "User is already an admin."
    );
    EternalStorage(_storageContract).setBooleanValue(keccak256(abi.encodePacked("admin:", _user)), true);

    // Decrement the admins count in storage
    uint adminsCount = EternalStorage(_storageContract).getUIntValue(keccak256("AdminsCount"));
    EternalStorage(_storageContract).setUIntValue(keccak256("AdminsCount"), adminsCount - 1);

    emit removeAdminEvent(_user);
  }

  function isAdmin(address _storageContract, address _user) public view returns(bool)
  {

    return EternalStorage(_storageContract).getBooleanValue(keccak256(abi.encodePacked("admin:", _user)));
  }

}
